import React from "react";
import styled from "styled-components";
import Step1Page, { Wrap, TitleBox, PlayingBox } from "./Step1Page";

const Step2Page = () => {
  return (
    <Wrap>
      <TitleBox>
        <h2>[2단계] 깐깐한 막대과자 손님</h2>
      </TitleBox>
      <PlayingBox> </PlayingBox>
    </Wrap>
  );
};

export default Step2Page;
